import styled from 'styled-components';
// import Bg from './img/Bg.jpg';

export const HomeDiv = styled.div`
    > h1 {
        padding-top: 41.875vh;
        font-size: 32px;
        margin: 0;
    }

    > button {
        padding: 10px 30px;
        margin-top: 80px;
    }
`

// export default HomeDiv

export const TestDiv = styled.image`
    > h3 {
        padding: 18px 0;
        background-color: white;
        color: black
    }

    .contentWrapper {
        margin-top:20vh;

        > img {
        width: 12.75rem;
        height: auto
        }

        .buttonWrapper {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;

            >button {
                font-size: 1rem;
                padding: 0.8rem 5.4rem;
                margin-top: 30px ;
                display: block;
            }
        }
    }
`
